# get Wikipedia Category Classification
def GeoClass(value,Category):
    # get category from wikipedia 
    for name in Category:
        #print(name)
        # check if name in our classification match the wikipedia category
        if name in str(value):
            return True
        else:
             continue
    return False

def GetPeriod(year):
	if(year < 1600):
		return "before1600"
	elif(1600 <= year < 1700):
		return "p1600-p1700"
	elif(1700 <= year < 1800):
	    return "p1700-p1800"
	elif(1800 <= year < 1850):
	    return "p1800-p1850"
	elif(1850 <= year < 1900):
	    return "p1850-p1900"
	elif(1900 <= year < 1920):
	    return "p1900-p1920"
	elif(1920 <= year < 1940):
	    return "p1920-p1940"
	elif(1940 <= year < 1960):
	    return "p1940-p1960"
	elif(1960 <= year < 1980):
	    return "p1960-p1980"
	elif(1980 <= year < 2000):
	    return "p1980-p2000"
	elif(2000 <= year < 2020):
		return "p2000-p2020"

